import React from "react";
import ReactDom from "react-dom";
import App from "./App";
import Details from "./Details_page";


import Card from "./Card"

function Webseries_card(value,index,arr){
    return (
        <Card
            card_img = {value.card_img}
            title = {value.title}
            links = {value.links}
            headname = {value.headname}
        />
    )
}




ReactDom.render(
<>
   <h1>List Of Top 50 Webseries</h1>
    {/* <App/> */}
    {Details.map}

</>,document.getElementById("root")
);
